import React from 'react';
import kinshipWords from "../root_words/kinship/kinship";

const WordSelectForm = (): JSX.Element => {
  return (
    <div>
      <div>
        <h3>
          Kinship
        </h3>

        {
          kinshipWords.map((wordObj) => {
            return Object.keys(wordObj)[0];
          })
        }
      </div>
    </div>
  );
};

export default WordSelectForm;
